import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
import { useUser } from "../context/UserContext";

function Navbar() {
  const { userData } = useUser();

  return (
    <header className="header">
      <div className="header-left">
        <h1 className="logo">Foodfolio</h1>
        <nav className="nav-links">
          <Link to="/dashboard">Home</Link>
          <Link to="/todolist">To-Do List</Link>
          <Link to="/notes">Notes</Link>
          <Link to="/waste-insights">Waste Insights</Link>
        </nav>
      </div>
      <div className="user-info">
        <span>
          Hi, <Link to="/profile">{userData.firstName || "John"} {userData.lastName?.charAt(0) || "D"}.</Link>
        </span>{" "}
        | <Link to="/settings">Settings</Link> | <Link to="/logout">Logout</Link>
      </div>
    </header>
  );
}

export default Navbar;
